import React from 'react'
import {Container, Row} from 'react-bootstrap';
import './Home.css';

function Home() {
  return (
    <div className='main'>
        <Container>
            <Row>
                <div className='intro-text'>
                    <div className='bg-light'>
                        <h1>Carta</h1>
                        <p>hola</p>
                    </div>
                </div>
            </Row>
        </Container>   
    </div>
  )
}

export default Home
